import React, { useState } from 'react';
import { BrowserRouter as Router, Switch, Redirect, Route } from 'react-router-dom';
import Contact from './Contact';
import Register from './Register';
import Login from './Login';
import About from './About';
import Home from './Home';
import Protected from './Protected'
import SelectBrand from './SelectBrand';
import Product from './Product';
import Header from './Header';

import Gender_product from './Gender_product';
import Gender from './Gender';
import Male_category from './Male_category';
const Main = () => {



    return (
        <>
            <Header />


            <Switch>
                <Route exact path='/login' component={Login} />

                <Route exact path='/register' component={Register} />
                <Route exact path='/selectbrand' component={SelectBrand} />

                <Route exact path='/about'>
                    <Protected component={() => {
                        return <About />
                    }} /></Route>

                <Route exact path='/women'>
                    <Protected component={() => {
                        return <Gender_product name="female" />
                    }} /></Route>

                <Route exact path='/men'>
                    <Protected component={() => {
                        return <Gender_product name="male" />
                    }} /></Route>

                <Route exact path='/kid'>
                    <Protected component={() => {
                        return <Gender_product name="kid" />
                    }} /></Route>


                <Route exact path='/contact'>
                    <Protected component={() => {
                        return <Contact />
                    }} /></Route>


                <Route exact path='/khaadi'>
                    <Protected component={() => {
                        return <Gender name="khaadi" />
                    }} /></Route>
                <Route exact path='/gulahmed'>
                    <Protected component={() => {
                        return <Gender name="gulahmed" />
                    }} /></Route>



                <Route exact path='/home'>
                    <Protected component={Home} />
                </Route>

                <Route exact path='gulahmed/male_category'>
                    <Protected component={Male_category} />
                </Route>



                <Route exact path='/product'>
                    <Protected component={Product} />
                </Route>


                <Route exact path='/gulahmed_eastren'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-shirt_pant" />
                    }} /></Route>
                <Route exact path='/gulahmed_westren_unstitched'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-kameezshalwar_unstitched" />
                    }} /></Route>
                <Route exact path='/gulahmed_westren_stitched'>
                    <Protected component={() => {
                        return <Product name="Gulahmed-male-kameezshalwar_stitched" />
                    }} /></Route>




                {/* <Route component={Error} /> */}
                <Redirect to='/home' />








            </Switch>



        </>
    )
}
export default Main;
